import React from "react";

const ItsOverNineThousand = ({ result, setResult }) => {
	const rendering = () => {
		if (setResult(eval(result).toString()) > 50) {
			return (
				<div>
					<h2>uah</h2>
					{rendering}
				</div>
			);
		}
	};
};

export default ItsOverNineThousand;
